import React, { Component } from "react";
import {
  NormalButton,
  TableWrapper,
  NormalCheckbox,
  NormalModal,
  NormalInput,
} from "component/common";
import "./style.scss";
import { AiOutlinePlus, AiOutlineMinus } from "react-icons/ai";
import {
  Races,
  NewRaces,
  updateCommon,
  Agegroups,
  NewAgegroups,
  Corporatecustomers,
  NewCorporatecustomers,
  SkinTypes,
  NewSkinTypes,
  Languages,
  NewLanguages,
  Locations,
  NewLocations,
  NewGenders,
  Genders,
} from "redux/actions/Backend";
import { withTranslation } from "react-i18next";
import { connect } from "react-redux";
import { bindActionCreators } from "redux";
import { BsPencilSquare } from "react-icons/bs";
import closeIcon from "assets/images/close.png";
import { Toast } from "service/toast";

export class CustomermastertwoClass extends Component {
  state = {
    customerDetails: [
      { label: "Code", divClass: "justify-content-end" },
      { label: "Age Group", divClass: "justify-content-end" },
      { label: "Description" },
      { label: "Active" },
      { label: "Action", divClass: "justify-content-center" },
    ],
    customertypeDetails: [
      { label: "Code", divClass: "justify-content-end" },
      { label: "Description" },
      { label: "Active" },
    ],
    commontable: [
      { label: "Code", divClass: "justify-content-end" },
      { label: "Description" },
      { label: "Active" },
      { label: "Active", divClass: "justify-content-center" },
    ],

    isoption: false,
    iscreation: false,
    iscustomer1: false,
    iscustomer2: false,
    iscustomer3: false,
    isproductgroup: false,
    iscustomertype: false,
    isgender: false,
    islocation: false,
    staffList: [],
    racelist: [],
    newid: null,
    newval: null,
    editid: null,
    editval: null,
    isAboutPopModal: false,
    isNewdescPopModal: false,
    agelist: [],
    agecode: null,
    newidtwo: null,
    newvaltwo: null,
    newvaldesc: null,
    editidtwo: null,
    editvaltwo: null,
    isAboutPopModaltwo: false,
    isNewdescPopModalage: false,
    customerlist: [],
    skintype: [],
    languagelist: [],
    locationlist: [],
    genderlist: [],
    skinid: null,
    skinval: null,
    editskinid: null,
    editskinval: null,
    isAboutPopModalskin: false,
    isNewdescPopModalskin: false,
    locationid: null,
    locationval: null,
    editlocationid: null,
    editlocationval: null,
    isAboutPopModallocation: false,
    isNewdescPopModallocation: false,
    languageid: null,
    languageval: null,
    editlanguageid: null,
    editlanguageval: null,
    isAboutPopModallanguage: false,
    isNewdescPopModallanguage: false,
    genderid: null,
    genderval: null,
    editgenderid: null,
    editgenderval: null,
    isAboutPopModalgender: false,
    isNewdescPopModalgender: false,
    activeitem: true,
  };

  componentDidMount = () => {
    this.ListofRaces({});
    this.Listofages({});
    this.Listofcustomer({});
    this.Listofskintype({});
    this.Listoflanguage({});
    this.Listoflocation({});
    this.Listofgender({});
  };

  updateState = (data) => {
    if (this.state.isMounted) this.setState(data);
  };

  ListofRaces = async () => {
    this.updateState({ is_loading: true });
    await this.props.Races().then((res) => {
      console.log(res);
      let { racelist } = this.state;

      racelist = res;
      console.log(racelist);
      this.setState({
        racelist,
        is_loading: false,
      });
      console.log(racelist.length);
    });
  };

  Listofages = async () => {
    this.updateState({ is_loading: true });
    await this.props.Agegroups().then((res) => {
      console.log(res);
      let { agelist } = this.state;

      agelist = res;
